// 76. Minimum Window Substring
// https://leetcode.com/problems/minimum-window-substring/

pub struct Solution;

use std::collections::{HashMap, HashSet};

impl Solution {
    pub fn min_window(s: String, t: String) -> String {
        if s.len() < t.len() {
            return "".to_string();
        }
        let string: Vec<char> = s.chars().collect();
        let spec: Specification = t.into();
        let mut left = 0usize;
        let mut right = spec.min_length;
        // define initial window
        let mut character_frequencies = HashMap::with_capacity(26 * 2);
        {
            for c in string[left..right]
                .iter()
                .filter(|c| spec.valid_keys.contains(c))
            {
                character_frequencies
                    .entry(*c)
                    .and_modify(|count| *count += 1usize)
                    .or_insert(1usize);
            }
        }

        let mut min_window: Option<(usize, usize)> = None;

        // check if initial window is valid
        let mut current_window_valid =
            Self::is_window_valid(left, right, &character_frequencies, &spec);
        if current_window_valid {
            min_window = Some((left, right));
        }

        while right <= string.len() {
            if current_window_valid {
                // shrink the window by moving the left bound
                let removed_char = string[left];
                left += 1;
                if spec.valid_keys.contains(&removed_char) {
                    let count = character_frequencies.get_mut(&removed_char).expect(
                        "Characters in any window should already have their frequency recorded",
                    );
                    *count = count.saturating_sub(1);
                }
                // check if still valid
                current_window_valid =
                    Self::is_window_valid(left, right, &character_frequencies, &spec);
                if current_window_valid && Self::is_smaller_window(left, right, &min_window) {
                    min_window = Some((left, right));
                }
            } else {
                // window not valid
                if right < string.len() {
                    right += 1;
                    // append frequency count for newly-added char
                    let new_char = string[right - 1];
                    if spec.valid_keys.contains(&new_char) {
                        character_frequencies
                            .entry(new_char)
                            .and_modify(|count| *count += 1)
                            .or_insert(1);
                        // check if we made a valid window
                        current_window_valid =
                            Self::is_window_valid(left, right, &character_frequencies, &spec);
                        if current_window_valid && Self::is_smaller_window(left, right, &min_window)
                        {
                            min_window = Some((left, right));
                        }
                    }
                } else {
                    break;
                }
            }
        }

        if let Some((left, right)) = min_window {
            return string[left..right].iter().collect();
        }

        "".to_string()
    }

    fn is_window_valid(
        left: usize,
        right: usize,
        character_frequencies: &HashMap<char, usize>,
        spec: &Specification,
    ) -> bool {
        if right - left < spec.min_length {
            return false;
        }
        for (required_char, required_count) in &spec.required_counts {
            let valid = if let Some(actual_count) = &character_frequencies.get(required_char) {
                *actual_count >= required_count
            } else {
                false
            };
            if !valid {
                return false;
            }
        }
        true
    }

    fn is_smaller_window(
        candidate_left: usize,
        candidate_right: usize,
        leading_window: &Option<(usize, usize)>,
    ) -> bool {
        if let Some((leading_left, leading_right)) = leading_window {
            let candidate_length = candidate_right - candidate_left;
            let leading_length = leading_right - leading_left;
            candidate_length < leading_length
        } else {
            true
        }
    }
}

#[derive(Debug)]
struct Specification {
    required_counts: HashMap<char, usize>,
    min_length: usize,
    valid_keys: HashSet<char>,
}

impl From<String> for Specification {
    fn from(value: String) -> Self {
        let min_length = value.len();
        // "`s` and `t` consist of uppercase and lowercase English letters."
        let mut required_counts = HashMap::with_capacity(26 * 2);
        let mut valid_keys = HashSet::with_capacity(26 * 2);
        for c in value.chars() {
            required_counts
                .entry(c)
                .and_modify(|count| *count += 1)
                .or_insert(1);
            valid_keys.insert(c);
        }
        required_counts.shrink_to_fit();
        valid_keys.shrink_to_fit();
        Self {
            required_counts,
            min_length,
            valid_keys,
        }
    }
}

#[cfg(test)]
mod tests {
    use super::Solution;

    #[test]
    fn example1() {
        // given
        let s = "ADOBECODEBANC";
        let t = "ABC";

        // when
        let result = Solution::min_window(s.to_string(), t.to_string());

        // then
        assert_eq!(result, "BANC".to_string());
    }

    #[test]
    fn example2() {
        // given
        let s = "a";
        let t = "a";

        // when
        let result = Solution::min_window(s.to_string(), t.to_string());

        // then
        assert_eq!(result, "a".to_string());
    }

    #[test]
    fn example3() {
        // given
        let s = "a";
        let t = "aa";

        // when
        let result = Solution::min_window(s.to_string(), t.to_string());

        // then
        assert_eq!(result, "".to_string());
    }

    #[test]
    fn example266() {
        // given
        let s = "";
        let t = "";

        // when
        let result = Solution::min_window(s.to_string(), t.to_string());

        // then
        assert_eq!(result, "".to_string());
    }
}
